import React from 'react'
import {useParams} from 'react-router-dom'

function Info() {
  let params = useParams();
  let login = params.login;

  getUserInfo = (login) => {
    fetch('https://api.github.com/users')
        .then(response => {
            return response.json();
        })
        .then(data => {
            this.setState({
                users : data
            })
        })
  }

  return (
    <div>{login}</div>
  )
}

export default Info
